import React, { Component } from 'react';

const PageThree =(props) => {
    const style = {
        border: '2px solid black',
    };
    return (
        <div className="container" style={style}>
        <p>PAGE 3</p>
        <h2>STP</h2>
        <p>Know your customers</p>
        Segmentation
        <input />
        <br/>
        Targeting
        <input />
        <br/>
        Positioning
        <input/>
        <br/>
        </div>
        )
}

export default PageThree
